package string.sliding_window;

import java.util.HashMap;
import java.util.Map;

public class MinimumWindowSubstringSol1 {

    String minWindow(String s, String t) {
        int n = s.length();

        int len = n + 1; // start from a large num that len cannot be
        int head = 0; // the head index of the final substring

        Map<Character, Integer> mapS = new HashMap<>(); // key - char, val - count
        Map<Character, Integer> mapT = new HashMap<>(); // key - char, val - count

        int haveCount = 0, needCount = 0;

        // prep needCount
        for (char c : t.toCharArray()) {
            mapT.put(c, mapT.getOrDefault(c, 0) + 1);
        }
        needCount = mapT.size();

        for (int l = 0, r = 0; r < n; r++) {
            // handle r
            char cur = s.charAt(r);
            mapS.put(cur, mapS.getOrDefault(cur, 0) + 1);
            if (mapT.containsKey(cur) && mapS.get(cur).equals(mapT.get(cur))) {
                // Note 1: In Java I cannot directly use mapT.get(cur) > 0 b/c possible null pointer exception
                // 2: In Java, Number object comparison should use .equals() instead of ==
                haveCount++;
            }

            // handle l
            while (haveCount == needCount) {
                // min result update
                if (r - l + 1 < len) {
                    head = l;
                    len = r - l + 1;
                }

                // move l
                char leftChar = s.charAt(l);
                mapS.put(leftChar, mapS.get(leftChar) - 1);
                if (mapT.containsKey(leftChar) && mapS.get(leftChar) < mapT.get(leftChar)) {
                    haveCount--;
                }
                l++;
            }
        }

        return len == n + 1 ? "" : s.substring(head, head + len);
    }

    public static void main(String[] args) {
        MinimumWindowSubstringSol1 test = new MinimumWindowSubstringSol1();
        String s1 = "";
        String t1 = "xshxlvswdb";
        System.out.println(test.minWindow(s1, t1)); // "bywsrlpxhssriprdqujzhnsaszmvqox"

        String s2 = "a";
        String t2 = "aa";
        System.out.println(test.minWindow(s2, t2)); // ""

//        String s3 = "";
//        String t3 = "";
//        String expect3 = "";
//        System.out.println(test.minWindow(s3, t3)); // expect3
    }
}
